import React from 'react';
import Photo from './Photo';

const Gallery = props => {
  const jsonData = props.data;

  let photos; 
  let pic = <Photo url={`https://farm${props.farm}.staticflickr.com/${props.server}/${props.id}_${props.secret}.jpg`}/>

  return(

    <div className="photo-container">
      <h2>Results</h2>
      <ul>
        {photos}
      </ul>
    </div>
  );
};

export default Gallery;
